const API = 'Fchhxqpcq2zoXHjbkrSTBgaRUXWIl3tk';

const getImagen = async () => {
    const response = await fetch(`http://api.giphy.com/v1/gifs/random?api_key=${ API }`);
    const data = await response.json();
    console.log(data);
}

getImagen();
